import React from 'react';
import axios from 'axios';

export const useFile = () => {
  const getFileData = async (fileName) => {
    const fileData = [];
    console.log('hello');
    const data = await axios.get(fileName);
    console.log(fileName);
    data.data.split('\n').forEach((line) => {
      const checkLine = line.split(' ');
      if (checkLine.length === 4) {
        fileData.push({
          dateID: checkLine[0],
          prodID: checkLine[1],
          catID: checkLine[2],
          fabID: checkLine[3],
        });
      }

      if (checkLine.length === 5) {
        fileData.push({
          dateID: checkLine[0],
          prodID: checkLine[1],
          catID: checkLine[2],
          fabID: checkLine[3],
          magID: checkLine[4],
        });
      }
    });
    return fileData;
  };
  return {
    getFileData,
  };
};
